import React from "react";
import '../style.css';

const Calculator = () => {
  return(
    <>
      <header>
        <div className="navbar">
          <h1 className="navbar-title">Calculator</h1>
        </div>
      </header> 
      <main>
        <section className="about-section">
        </section>
      </main>
    </>
  )
};

export default Calculator;
